import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom'

function Navbar1() {
  return (
    <>
      <Navbar className='grey' variant="dark">
        <Container>
          <Navbar.Brand> <Link className="main-nav-link" to="/"><h1>BREWDOG</h1></Link></Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link> <Link className="main-nav-link" to="/search">Search</Link></Nav.Link>
            <Nav.Link>  <Link className="main-nav-link" to="/favourite">Favourites</Link></Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </>
  )
}

export default Navbar1;
